{% load static %}<!doctype html><html lang="en"><head><meta charset="utf-8"/><meta name="viewport" content="width=device-width,initial-scale=1"/><meta name="theme-color" content="#000000"/><meta name="description" content="Django Data Browser"/><link href="https://fonts.googleapis.com/css2?family=Roboto&display=swap" rel="stylesheet"/><link href="https://fonts.googleapis.com/css2?family=Noto+Sans&display=swap" rel="stylesheet"/><link href="https://fonts.googleapis.com/icon?family=Material+Icons" rel="stylesheet"/><link href="https://fonts.googleapis.com/css?family=Material+Icons|Material+Icons+Outlined" rel="stylesheet"/><link href="https://fonts.googleapis.com/css2?family=Anton&display=swap" rel="stylesheet"/><link rel="apple-touch-icon" sizes="180x180" href="{% url 'data_browser:home' %}apple-touch-icon.png"/><link rel="icon" type="image/png" sizes="32x32" href="{% url 'data_browser:home' %}favicon-32x32.png"/><link rel="icon" type="image/png" sizes="16x16" href="{% url 'data_browser:home' %}favicon-16x16.png"/><link rel="manifest" href="{% url 'data_browser:home' %}site.webmanifest"/><title>View</title><style>ul.messagelist{padding:0;margin:0}ul.messagelist li{display:block;font-weight:400;font-size:13px;padding:10px 10px 10px 65px;margin:0 0 10px 0;background:#dfd url('{% static "admin/img/icon-yes.svg" %}') 40px 12px no-repeat;background-size:16px auto;color:#333;line-height:20px}ul.messagelist li.warning{background:#ffc url('{% static "admin/img/icon-alert.svg" %}') 40px 14px no-repeat;background-size:14px auto}ul.messagelist li.error{background:#ffefef url('{% static "admin/img/icon-no.svg" %}') 40px 12px no-repeat;background-size:16px auto}</style>{% block extrahead %} {% endblock %}<script defer="defer" src="./static/js/main.c4ca9cb3.js"></script><link href="./static/css/main.c698af7a.css" rel="stylesheet"></head><body>{% block messages %} {% if messages %}<ul class="messagelist">{% for message in messages %}<li {% if message.tags %} class="{{ message.tags
